<style lang="less" scoped>
  .clear-both {
    clear: both;
    content: "";
  }
  .section-sticky {
    height: 1334rpx;
    background-color: #fff;
  }
  .section-top {
    height: 380rpx;
  }
  .higherTop {
    height: 488rpx;
  }
  .banner {
    /*background-image: url("../../static/assets/images/h5/banner-society.jpg");*/
    background-image: url(data:image/jpeg;base64,);
    width: 750rpx;
    height: 282rpx;
    background-size: 100%;
    background-repeat: no-repeat;
    position: relative;
    p {
      font-size: 54rpx;
      color: #fff;
      font-family: 'PingFang-SC-Heavy';
      position: absolute;
      top: 84rpx;
      left: 56rpx;
    }
  }
  .header {
    width: 100%;
    height: 98rpx;
    border-bottom: 1rpx solid #e1e1e1;
    background-color: #fff;
    padding-left: 10rpx;
    .tab-item {
      float: left;
      margin: 30rpx 26rpx 0 26rpx;
      font-size: 28rpx;
      font-family: 'PingFang-SC-Bold';
    }
    .tabActive {
      color: #1c70c8;
    }
    .active-line {
      width: 52rpx;
      height: 6rpx;
      margin: 5rpx auto;
      background: linear-gradient(to right, #277ecf, #70afe9);
      background: -ms-linear-gradient(to right, #277ecf, #70afe9);
      background: -webkit-linear-gradient(to right, #277ecf, #70afe9);
      background: -moz-linear-gradient(to right, #277ecf, #70afe9);
    }
  }
  .secondTab {
    height: 206rpx;
    position: relative;
  }
  .tab-content {
    width: 100%;
  }
  @import "../common.less";
  .section-sticky /deep/ .van-cell {
    padding: 10rpx 26rpx 5rpx 26rpx;
  }
  .section-sticky /deep/ .van-dropdown-item__content {
    padding-left: 46rpx;
  }
</style>
<template>
  <div class="section-sticky">
    <div class="content" id="top" :class="{higherTop: hasSecondTab}">
      <div class="banner">
        <!--<p>社会保障</p>-->
      </div>
      <van-sticky>
        <div class="header" :class="{secondTab: hasSecondTab}">
          <div v-for="(item, index) in tabListShow" v-if="tabRowShow===0" class="tab-item" :class="{tabActive: index===tabActiveIndex}" @click="changeShow(index)">
            <span>{{item}}</span>
            <div v-if="index===tabActiveIndex" class="active-line"></div>
          </div>
          <div v-for="(item, index) in tabListShow" v-if="tabRowShow===1" class="tab-item" :class="{tabActive: index===tabActiveIndex-4}" @click="changeShow(index+4)">
            <span>{{item}}</span>
            <div v-if="index===tabActiveIndex-4" class="active-line"></div>
          </div>
          <van-dropdown-menu>
            <van-dropdown-item title="" ref="item" v-model="tabActiveIndex" :options="tabListText" @change="changeShow">
            </van-dropdown-item>
          </van-dropdown-menu>
        </div>
      </van-sticky>
      <div class="clear-both"></div>
      <div class="tab-content">
        <overall-situation v-if="tabActiveIndex===0" :tabData="tabData"></overall-situation>
        <old-security v-if="tabActiveIndex===1" :tabData="tabData"></old-security>
        <medical-security v-if="tabActiveIndex===2" :tabData="tabData"></medical-security>
        <unemployment-security v-if="tabActiveIndex===3" :tabData="tabData"></unemployment-security>
        <industrial-security v-if="tabActiveIndex===4" :tabData="tabData"></industrial-security>
        <fertility-security v-if="tabActiveIndex===5" :tabData="tabData"></fertility-security>
        <housing-security v-if="tabActiveIndex===6" :tabData="tabData"></housing-security>
      </div>
    </div>
  </div>
</template>

<script>
  import {getDataByTabName} from "../../api/h5-chart";
  import OverallSituation from "./overall-situation";
  import OldSecurity from "./old-security";
  import MedicalSecurity from "./medical-security";
  import UnemploymentSecurity from "./unemployment-security";
  import IndustrialSecurity from "./industrial-security";
  import FertilitySecurity from "./fertility-security";
  import HousingSecurity from "./housing-security";
  import Notify from "vant/es/notify";
  import {remToPx} from "../../libs/util";

  export default {
    name: "index",
    components: {
      HousingSecurity,
      FertilitySecurity,
      IndustrialSecurity, UnemploymentSecurity, MedicalSecurity, OldSecurity, OverallSituation},
    data() {
      return {
        hasSecondTab: false,
        tabListText: [
          { text: '整体概况', value: 0 },
          { text: '养老保障', value: 1 },
          { text: '医疗保障', value: 2 },
          { text: '失业保障', value: 3 },
          { text: '工伤保障', value: 4 },
          { text: '生育保障', value: 5 },
          { text: '住房保障', value: 6 },
        ],
        // 当前显示的tab页
        tabListShow: [],
        // 当前显示的tab页是第几行
        tabRowShow: '',
        tabActiveIndex: '',
        subTabActiveIndex: '',
        subTabList: [],
        tabData: {},
      }
    },
    mounted() {
      this.initDOM();
      this.changeShow(0);
      // 添加屏幕滚动的监听
      window.addEventListener("scroll", this.handleScroll);
    },
    beforeDestroy() {
      // 销毁已创建的监听
      window.removeEventListener('scroll', this.handleScroll);
    },
    methods: {
      initDOM() {
        document.getElementById("top").scrollIntoView(true);
        this.tabRowShow = 0;
        // 初始显示前4个tab页
        this.sliceObject(this.tabListText, 0, 3);
      },
      // 通过传递的参数，确定当前显示的tab页是哪一部分
      sliceObject(obj, min, max) {
        obj.forEach((item, index) => {
          if (index >= min && index <= max) {
            this.tabListShow.push(item.text);
          }
        })
      },
      // 点击Tab页
      changeShow(value) {
        // document.getElementById("top").scrollIntoView(true);
        document.getElementById("top").scrollIntoView(true);
        this.tabListShow = [];
        this.subTabActiveIndex = 0;
        // 先进行判断当前点击的是在第一行还是在第二行
        if (value > 3) {
          this.tabRowShow = 1;
          this.sliceObject(this.tabListText, 4, this.tabListText.length-1);
        } else {
          this.tabRowShow = 0;
          this.sliceObject(this.tabListText, 0, 3);
        }
        this.changeTab(value);
      },
      // 切换tab页时针对每个tab页不同的处理
      changeTab(index) {
        this.tabActiveIndex = index;
        this.subTabList = [];
        let params = {
          name: this.tabListText[index].text,
        };
        getDataByTabName(params, res => {
          if(res.data) {
            console.log(res.data);
            this.tabData = res.data;
            // this.judgeHasSubTab(this.tabData.data);
            // 切换tab时获取当前tab页的各标签页高度
            // this.setSubTabOffset(index);
          } else {
            Notify({ type: 'danger', message: '获取数据错误' });
          }
        }, err => {
          Notify({ type: 'danger', message: '服务器错误'+err });
        });
      },
      // 监听的页面滚动事件
      handleScroll() {
        if (this.hasSecondTab === true) {
          // 获取当前页面已经滚动的高度
          let scrollTop = window.pageYOffset;
          let tabActive = this.tabActiveIndex;
          // 获取当前激活页面的存放二级tab高度的数组
          let tabActiveOffset = this.subIndexOffset[tabActive];
          let arrayLength = tabActiveOffset.length;
          for (let i = 0; i < arrayLength ; i++) {
            // 将数组中的每一个高度与当前滚动的高度作比较，获取当前激活的是哪个tab
            if (scrollTop > (tabActiveOffset[i] - remToPx(230/75))) {
              this.subTabActiveIndex = i;
            }

          }
        }
      }
    }
  }
</script>


